  false,\n\t\"url\": null,\n\t\"notes\": \"The National Estuarine Research Reserve
  System's System-wide Monitoring Program (NERRS SWMP) collected water quality, meteorological,
  and nutrient data in 26 reserves in the United States and Puerto Rico from January
  1, 1995 to August 1, 2011. The NERRS Centralized Data Management Office (CDMO) assembled
  these data and submitted them to NODC per the \"Memorandum of Understanding between
  the Office of Ocean and Coastal Resource Management and the National Oceanographic
  Data Center Concerning the Transmittal of National Estuarine Research Reserve System
  Water Quality Monitoring Data.\" Water quality parameters include temperature, water
  depth, salinity, pH, dissolved oxygen, and turbidity. Meteorological parameters
  include air temperature, wind speed and direction, relative humidity, barometric
  pressure, rainfall, and photosynthetically active radiation (PAR). Nutrient parameters
  include concentrations of ammonium, nitrate, nitrite, and ortho-phosphate.\",\n\t\"license_title\":
